INSERT INTO `wp_options` VALUES (265,'elementor_remote_info_feed_data','a:5:{i:0;a:5:{s:5:\"title\";s:72:\"Special 6th Birthday Gift Pack: Free Icons, Stickers, and Illustrations!\";s:7:\"excerpt\";s:179:\"Here’s your chance to celebrate Elementor’s 6th birthday festivities by getting your very own collection of our FREE party-inspired pack of icons, stickers, and illustrations!\";s:7:\"created\";i:1653396992;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:158:\"https://elementor.com/blog/sixth-birthday-gift-pack-free-icons-stickers-illustrations/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:37:\"What Exactly Does a Web Host Provide?\";s:7:\"excerpt\";s:259:\"If you want to build a website, you need a web host to provide the computing resources to power it and make it available to visitors around the world. In this post, we\'ll discuss what a web host is and what services you should expect from a quality web host.\";s:7:\"created\";i:1652955962;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/what-does-web-host-provide/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:32:\"Elementor Websites of April 2022\";s:7:\"excerpt\";s:301:\"April’s showcase offers plenty of ideas to spruce up your web design as things begin to slowly heat up. From international organizations and real estate to designers, studios, and consultants plus a picturesque island that will take your breath away, this month’s websites will leave you inspired.\";s:7:\"created\";i:1652720134;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/showcase-april-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:46:\"NFT 101: A Beginner’s Guide for Web Creators\";s:7:\"excerpt\";s:298:\"NFTs have taken the world by storm, providing web designers with fresh opportunities to earn money and distribute their work to larger audiences around the globe. In this article, we\'ll break down what NFTs are and how to use them practically (plus, a sneak peek at our new NFT landing page kits!).\";s:7:\"created\";i:1651578283;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:114:\"https://elementor.com/blog/nft-web-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:29:\"What Is Inclusive Web Design?\";s:7:\"excerpt\";s:297:\"When designing a website, it is important to keep in mind that not all users interact with it in the same way. Using inclusive design will help you remove bias and assumptions from your website and ensure that users will not feel excluded. Keep reading to learn how to master this modern approach.\";s:7:\"created\";i:1651142542;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/inclusive-web-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','no');
