INSERT INTO `wp_posts` VALUES (20,1,'2022-04-11 16:50:31','2022-04-11 16:50:31','<!-- wp:paragraph {\"backgroundColor\":\"secondary\"} -->\n<p class=\"has-secondary-background-color has-background\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\n<!-- /wp:paragraph -->','Home','','publish','open','open','','home','','','2022-05-29 18:18:24','2022-05-29 18:18:24','',0,'http://localhost:10004/?p=20',0,'post','',0);
