INSERT INTO `wp_posts` VALUES (95,1,'2022-06-22 16:12:11','2022-06-22 16:12:11','<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>div id=\"contakt-form\"&gt;\n    &lt;div class=\"wrapper\"&gt;\n    &lt;div class=\"contakt-form-info\"&gt;\n    &lt;ul&gt;\n    &lt;li class=\"contakt-info cinfo1\"&gt;&lt;i class=\"icon-clock\"&gt;&lt;/i&gt;&lt;h3&gt;График работы&lt;/h3&gt;&lt;span&gt;Пн. — Пт.&lt;/span&gt;&lt;span&gt;Суб. и Воскр. выходные дни&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=\"contakt-info cinfo2\"&gt;&lt;i class=\"icon-phone3\"&gt;&lt;/i&gt;&lt;h3&gt;Телефон&lt;/h3&gt;&lt;span&gt;+49-176-286-034-64&lt;/span&gt;&lt;span&gt;Время приема звонков 9:00 — 15:00&lt;br&gt;(UTC+01:00) Берлин&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=\"contakt-info cinfo3\"&gt;&lt;i class=\"icon-at\"&gt;&lt;/i&gt;&lt;h3&gt;Е-mail&lt;/h3&gt;&lt;span&gt;info@mirtechniki.net&lt;/span&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=\"contakt-info cinfo4\"&gt;&lt;i class=\"icon-home\"&gt;&lt;/i&gt;&lt;h3&gt;Адрес&lt;/h3&gt;&lt;span&gt;MirTechniki.NET&lt;/span&gt;&lt;span&gt; Rudolstaedter Str. 12,&lt;br&gt;07549 Gera, Germany&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=\"contakt-info cinfo5\"&gt;&lt;i class=\"icon-profile\"&gt;&lt;/i&gt;&lt;h3&gt;Регистрационные данные&lt;/h3&gt;&lt;span&gt;St.Nr.: 161/278/01804&lt;/span&gt;&lt;span&gt;USt-ID: DE285816060&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=\"contakt-info cinfo6\"&gt;&lt;i class=\"icon-bank\"&gt;&lt;/i&gt;&lt;h3&gt;Расчетный счет&lt;/h3&gt;&lt;span&gt;Deutsche Kreditbank AG&lt;br&gt;Taubenstrasse 7-9,&lt;br&gt;10117 Berlin, Germany&lt;/span&gt;&lt;span&gt;IBAN: DE73 1203 0000 1011 2461 29&lt;br&gt;SWIFT-BIC: BYLADEM 1001&lt;/span&gt;&lt;/li&gt;\n    &lt;/ul&gt;\n    &lt;/div&gt;\n   \n   &lt;div class=\"contakt-form-fehld\"&gt;\n    &lt;h2&gt;Форма обратной связи&lt;/h2&gt;\n    &lt;p&gt;Вы можете отправить нам сообщение по электронной почте с помощью следующей формы:&lt;/p&gt;\n    &lt;input type=\"text\" name